_DESCRIPTION_:
Giraffe GF-AC0204PoE - сетевой коммутатор содержит 6 портов со скоростью передачи данных 10/100 Мб/с, в том числе 4 порта стандарта IEEE 802.3af и обеспечивает:Электропитание оборудования в точках беспроводного доступа и устройств (камер) видеонаблюдения по кабельной структуре 5-й категории;
PoE мощность до 15,4 Вт на порт (3-й класс);
Общую мощность всех PoE портов до 110 Вт;
Поддержку стандарта IEEE 802.3af, присвоенного для питаемых устройств (PD);
Поддержку IEEE 802.3x для работы в полно-дуплексном и полу-дуплексном форматах;
Доступ к 1000 МАК-адресов системы.На объекте изделие монтируется посредством комплекта крепления, его электропитание осуществляется через адаптер, входящий в комплект поставки.

Giraffe GF-AC0108PoE - сетевой коммутатор применяется в составе охранной телевизионной системы по ГОСТ Р 51558-2008. Изделие содержит 9 портов со скоростью передачи данных 10/100 Мб/с, в том числе 8 портов стандарта IEEE 802.3af и обеспечивает:Электропитание оборудования в точках беспроводного доступа и устройств (камер) видеонаблюдения по кабельной структуре 5-й категории;
PoE мощность до 15,4 Вт на порт (3-й класс);
Общую мощность всех PoE портов до 110 Вт;
Поддержку стандарта IEEE 802.3af, присвоенного для питаемых устройств (PD);
Поддержку IEEE 802.3x для работы в полно-дуплексном и полу-дуплексном форматах;
Доступ к 1000 МАК-адресов системы.На объекте изделие монтируется посредством комплекта крепления, его электропитание осуществляется через адаптер, входящий в комплект поставки.
